import { BrowserRouter } from 'react-router-dom';
import './app.css';
import Navbar from './components/navbar/Navbar';
import Topbar from './components/topbar/Topbar';

function App() {
  return (
    <BrowserRouter>
      <Topbar />
      <div className="app">
        <Navbar />
      </div>
    </BrowserRouter>
  );
}

export default App;
